import React from "react";
import productStyles from "./Product.module.css";

function Product() {
  return (
    <div className={productStyles.container}>
      <div className={productStyles.description}></div>
      <div className={productStyles.productImage}></div>
      <div className={productStyles.productBtn}></div>
    </div>
  );
}

export default Product;
